import React from "react";

export default function SectionTag(props) {
  switch (props.sectionName) {
    case "world":
      return (
        <button type="button" style={{ background: "#8A2BE2" }}>
          {props.sectionName}
        </button>
      );
      break;
    case "politics":
      return (
        <button type="button" style={{ background: "#228B22" }}>
          {props.sectionName}
        </button>
      );
    case "business":
      return (
        <button type="button" style={{ background: " #1E90FF" }}>
          {props.sectionName}
        </button>
      );
    case "technology":
      return (
        <button type="button" style={{ background: " #7CFC00" }}>
          {props.sectionName}
        </button>
      );

    default:
      return (
        <button type="button" class="btn btn-primary">
          {props.sectionName}
        </button>
      );
      break;
  }
}
